		async function fetchingPopulation(uri, number, db) {
			const div = document.querySelector("div");
			const start = performance.now();
			let end;

			const response = await fetch(`${uri}${number}`, {
				method: "GET",
				mode: "cors",
				cache: "default",
			})
			const data = await response.json();

			const stringified = JSON.stringify(data);
			div.innerHTML = stringified;
			end = performance.now();

			const result = end - start;

			if (localStorage.getItem(db)) {
				let allYears = localStorage.getItem(db).split();
				allYears.push(result);
				allYears.toString();
				localStorage.setItem(db, allYears);
			} else {
				localStorage.setItem(db, result);
			}

		}

		const pc = "http://192.168.1.32:3000/";
		async function getPop(database) {
			for (let i = 0; i < population.length; i++) {
				console.log(i);
				await fetchingPopulation(
					`${pc}${database}/population/`,
					population[i],
					`${database}Population`
				);
				if (i === population.length - 1) {
					console.log("DONE");
				}
			}
		}
